import { Request, Response } from 'express';
import mongoose from 'mongoose';

import Config from '../config';
import ReportsService from '../services/reportsService';
import CompanyService from '../services/companyService';
import UnitService from '../services/unitService';
import UserService from '../services/userService';
import AssetService from '../services/assetService';

/**
 * Remove all collections from DB
 * @return Promise
 */
const removeAllCollections = async () => {
  const collections = Object.keys(mongoose.connection.collections);
  for (const collectionName of collections) {
    const collection = mongoose.connection.collections[collectionName];
    await collection.deleteMany({});
  }
};

/**
 * Drop All collections from DB
 * @return Promise
 */
const dropAllCollections = async () => {
  const collections = Object.keys(mongoose.connection.collections);
  for (const collectionName of collections) {
    const collection = mongoose.connection.collections[collectionName];
    try {
      await collection.drop();
    } catch (error) {
      // Sometimes this error happens, but you can safely ignore it
      if (error.message === 'ns not found') return;
    }
  }
};

/**
 * Mock a function from a service
 * @param service service to mock
 * @param methods methods names to mock
 * @param mockFn function to be called on mocked method
 * @return void
 */
const doServiceMock = (
  service:
    | typeof ReportsService
    | typeof CompanyService
    | typeof UnitService
    | typeof UserService
    | typeof AssetService,
  methods: string[],
  mockFn: () => never,
): void => {
  methods.forEach(fnToMock => {
    const createdMock = jest.spyOn<typeof service, never>(
      service,
      fnToMock as never,
    );
    createdMock.mockImplementation(mockFn);
  });
};

/**
 * Mock an express Request
 * @param params req.params to mock
 * @param query req.query to mock
 * @param body req.body to mock
 * @param currentUser req.currentUser to mock
 * @return mocked req
 */
const mockRequest = (
  params: Record<string, unknown>,
  query: Record<string, unknown>,
  body: Record<string, unknown>,
  currentUser: Record<string, unknown> = {},
): Request => ({ params, query, body, currentUser } as unknown as Request);

/**
 * Mock an express Response
 * @return mocked res
 */
const mockResponse = (): Response => {
  const res: Record<string, unknown> = {};
  res.status = jest.fn().mockReturnValue(res);
  res.json = jest.fn().mockReturnValue(res);
  return res as unknown as Response;
};

const originalConsoleError = console.error;

/**
 * Setup for tests
 * @param usesDB if in memory DB should be used
 * @return void
 */
const setupTest = (usesDB: boolean): void => {
  // Connect to Mongoose
  beforeAll(async () => {
    console.error = jest.fn();
    if (usesDB) {
      await mongoose.connect(
        process.env.MONGO_URL || '',
        Config.mongooseOptions,
        err => {
          if (err) {
            console.error(err);
            process.exit(1);
          }
        },
      );
    }
  });

  // Cleans up database between each test
  afterEach(async () => {
    if (usesDB) {
      await removeAllCollections();
    }
  });

  // Disconnect Mongoose
  afterAll(async () => {
    console.error = originalConsoleError;
    if (usesDB) {
      await dropAllCollections();
      await mongoose.connection.close();
    }
  });
};

const base64Image =
  'data:image/png;base64,';

export { setupTest, doServiceMock, mockRequest, mockResponse, base64Image };
